import "./Shop.css";
import { Link } from "react-router-dom";
import axios from "axios";
import React, { Component } from "react";

class Shop extends Component {
  render() {
    return (
      <div>
        <form className="shop">
          <div>
            <h1>List of Categories</h1>
          </div>
          <div>
            <Link to="/about">
              <button className="click">+</button>
            </Link>
          </div>
        </form>
      </div>
    );
  }
}
export default Shop;
